// Intercetta la richiesta GET reale e restituisce un mock
cy.intercept('GET', '**/users', {
  statusCode: 200,
  body: [{
    id: 999,
    name: 'Mocked User',
    email: 'mocked@user.com'
  }, {
    id: 1000,
    name: 'Another Mock',
    email: 'another@mock.com'
  }]
}).as('mockUsers');
// Visita la pagina HTML locale
cy.visit('cypress/e2e/demo_users.html');
// Click sul bottone per generare la fetch
cy.get('#load-users').click();
// Aspetta che la chiamata intercettata avvenga
cy.wait('@mockUsers').its('response.statusCode').should('eq', 200);
// Controlla che i dati mockati siano visibili nel DOM
cy.get('#users-list').should('contain.text', 'Mocked User');
cy.get('#users-list').should('contain.text', 'Another Mock');
